import React from 'react';

// import { Container } from './styles';

function todoList() {
  return (<div className="todoList">
  <h1>Sua lista de compras</h1>
  <form>
  <label>
    Name:
    <input type="text" name="name" />
  </label>
  <input type="submit" value="Submit" />
</form>
</div>);
}

export default todoList;
